CREATE TABLE `headers` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_agant` text COLLATE utf8mb4_general_ci NOT NULL COMMENT '请求头',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

CREATE TABLE `log` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `step` bigint NOT NULL COMMENT '当前刷的步数',
  `status` enum('success','failed') COLLATE utf8mb4_general_ci NOT NULL COMMENT '请求状态',
  `today` date NOT NULL COMMENT '刷步数的日期',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '入库日期',
  `message` text COLLATE utf8mb4_general_ci NOT NULL COMMENT '提示信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

